import { Link } from "react-router-dom";

const AnimeList = ({anime}) => {
    return ( 
        anime.map((ani) => (
            <div className="table">
                <tr >
                    
                    <td scope="col">{ani.id}</td>
                    <td scope="col"><img src={ani.pic}/></td>
                    <td scope="col">{ani.title}</td>
                    <td scope="col">{ani.score}</td>
                    
                </tr>
            </div>
        ))

     );
}
 
export default AnimeList;
